def _get_b64(value: PresetImageKind) -> ByteString:
    if value == PresetImageKind.BATHROOM_TILES:
        return _get_b64_bathroom_tiles()
    if value == PresetImageKind.BRICK_WALL:
        return _get_b64_brick_wall()
    if value == PresetImageKind.CARDBOARD:
        return _get_b64_cardboard()
    if value == PresetImageKind.COFFEE_BEANS:
        return _get_b64_coffee_beans()
    if value == PresetImageKind.COLOR_STRIPES:
        return _get_b64_color_stripes()
    if value == PresetImageKind.COLORFUL_PEBBLES:
        return _get_b64_colorful_pebbles()
    if value == PresetImageKind.CONCRETE:
        return _get_b64_concrete()
    if value == PresetImageKind.FENCE:
        return _get_b64_fence()
    if value == PresetImageKind.FLORAL:
        return _get_b64_floral()
    if value == PresetImageKind.ICE_LIGHT:
        return _get_b64_ice_light()
    if value == PresetImageKind.INVOICE_PAPER:
        return _get_b64_invoice_paper()
    if value == PresetImageKind.LAWN:
        return _get_b64_lawn()
    if value == PresetImageKind.LITTLE_CLOUDS:
        return _get_b64_little_clouds()
    if value == PresetImageKind.MAPLE_LEAVES:
        return _get_b64_maple_leaves()
    if value == PresetImageKind.MARBLE:
        return _get_b64_marble()
    if value == PresetImageKind.PAINTED_WHITE:
        return _get_b64_painted_white()
    if value == PresetImageKind.PAPER_CRUMPLED:
        return _get_b64_paper_crumpled()
    if value == PresetImageKind.PAPER_GRAPH:
        return _get_b64_paper_graph()
    if value == PresetImageKind.PAPER_TEXTURE:
        return _get_b64_paper_texture()
    if value == PresetImageKind.PARCHMENT_PAPER:
        return _get_b64_parchment_paper()
    if value == PresetImageKind.POOL:
        return _get_b64_pool()
    if value == PresetImageKind.SAND_LIGHT:
        return _get_b64_sand_light()
    if value == PresetImageKind.SPACE:
        return _get_b64_space()
    if value == PresetImageKind.STONE:
        return _get_b64_stone()
    if value == PresetImageKind.STONE_WALL:
        return _get_b64_stone_wall()
    if value == PresetImageKind.SURFACE:
        return _get_b64_surface()
    if value == PresetImageKind.STUDIO:
        return _get_b64_studio()
    if value == PresetImageKind.WALL_OF_ROCK:
        return _get_b64_wall_of_rock()
    if value == PresetImageKind.WHITE_DIFFUSION:
        return _get_b64_white_diffusion()

    return _get_b64_zebra()


def get_prest_bitmap(preset: PresetImageKind) -> XBitmap:
    """
    Gets preset Image

    Args:
        preset (ImageKind): Present image to return

    Returns:
        XBitmap: Preset Image
    """
    b64 = _get_b64(preset)
    bargs = BitmapArgs(name=str(preset), auto_name=False, auto_update=False)
    return ImagesLo.get_bitmap_from_b64(b64, bargs, preset._img_fmt())


